import React from 'react';

const Header = () => {
    return ( 
        <div className="nav">
            <div className="nav_logo">
                <a href="#!" className="logo">Dereck</a>
            </div>
            <div className="nav_icons">
            <ion-icon name="menu-outline"></ion-icon>
                <a href="#!">Home</a>
                <a href="#!">About me</a>
                <a href="#!">Contact</a>
            </div>
        </div>
    );
}

export default Header;
